import SurfSpot from './SurfSpot'

const Home = ({data}) => {
    const [progress, setProgress] = useState()
    return(
        <div className="home"> 
                <progress value={0} />
            {data && <SurfSpot spots={data} />}
        </div>
    )
}

export default Home;
